import "./hero.css";

const Hero = () => {
    return <div className="hero">
            <h1 class=" hero__content--title">Skyz<span>CRM</span></h1>
            <p class="hero__content--para" id="heroPara">
                Manage customers in real time at a glance.
            </p>
            <div class="hero__content--links">
                <a href="#contact" class="btn-primary" id="heroBtnGetStarted">Get Started</a>
                <a href="#login" class="btn-primary" id="heroBtnLogin">Login</a>
            </div>
  </div>;
};

export default Hero;
